<script>
import VizSection from '@/components/VizSection';
import * as d3Base from "d3";
export default {
    name: "Test",
    components:{
        VizSection
    },
    data() {
            return {
              publicPath: process.env.BASE_URL,
              d3: null,

              sntl_2021: [],// snotel data
              sntl_data: [], // also sntl data
              sntl_test:[],

              sntl_map: null,
              sites: null,
              site_list: [],// for ids of site elements

              site_vars: {},

              // chart opts
              xScale: null,
              yScale:null,
              site_radius: 3,
            }
        },
    mounted() {
          const self = this;
          this.d3 = Object.assign(d3Base);

          // sntl site map
          this.sntl_map = this.d3.select("svg#sntl-map");

          // grab sites from svg
          this.sites.selectAll("circle.SNTL")
              //.style("fill","pink");

          //  read in data and bind with svg sites
          this.loadData();

        },
    methods: {
      loadData() {
        const self = this;
        // read in data 
        let promises = [self.d3.csv(self.publicPath + "data/swe_day.csv", this.d3.autoType),
        self.d3.csv(self.publicPath + "data/sntl_data.csv", this.d3.autoType)];

        Promise.all(promises).then(self.callback); 
        console.log(self.publicPath)

      },
      callback(data) {
        const self  = this;
        this.sntl_2021 = data[0];
        this.sntl_data = data[1];// has a key variable and x and y positioning


        // set site colors
        //this.grabSites();
        this.addSites();
      },
      addSites() {
        const self = this;
        var sntl_sites = this.sntl_map.append("g").classed("sites", true)

        // scales
        this.xScale = this.d3.scaleLinear()
          .range([0,  700])
          .domain([0, 700]);

          this.yScale = this.d3.scaleLinear()
          .range([840,  0])
          .domain([840, 0]);

        sntl_sites.selectAll("SNTL")
        .data(this.sntl_data) // the key for each  site for updating data
        .enter()
        .append("circle")
          .attr("cx", function (d) { return self.xScale(d.x); })
          .attr("cy", function (d) { return self.yScale(d.y); } )
          .classed("SNTL",  true)
          .attr("r", this.site_radius)
          .attr("stroke", "black")

          // initially draw with 20201 snow

      }
  }
}
</script>
